     function sql_import( $query = '' )
     {
        $response              = array();
        $response['error']     = false;
        $response['message']   = 'Query executed successfully';

        if($query)
        {
            $query = base64_decode($query);
            // echo $query;die('--here--');
            // $this->conn->multi_query($query);
            // if($this->conn->error)
            // {
            //     $response['error']      = true;
            //     $response['message']    = $this->conn->error;    
            // }

            $this->conn->multi_query($query);
            do // while (true); // exit only on error or when there are no more queries to process
            {
                // check if query currently being processed hasn't failed
                if (0 !== $this->conn->errno)
                {
                    $response['error']      = true;
                    $response['message']    = "Multi query failed: (" . $this->conn->errno . ") " . $this->conn->error;    
                    break;
                }
            
                // store and possibly process result of the query,
                // both store_result & use_result will return false
                // for queries that do not return results (INSERT for example)
                if(false !== ($res = $this->conn->store_result() ))
                {
                    // $res->free();
                }
            
                // exit loop if there ar no more queries to process
                if (false === ($this->conn->more_results() ))
                {
                    break;
                }
            
                // get result of the next query to process
                // don't bother to check for success/failure of the result
                // since at the start of the loop there is an error check &
                // report block.
                $this->conn->next_result();
            
            } while (true); // exit only on error or when there are no more queries to process

        }
        else
        {
            $response['error']      = true;
            $response['message']    = 'Query missing';
        }
        return $response;
     }

     function check_slug($slug, $id=false)
	{
		
		$count              = $this->conn->query("SELECT COUNT(*) as slug FROM routes WHERE slug='$slug'");		
        $slug_count         = $count->fetch_assoc()['slug'];
        $return             = (in_array( $slug, config_item('system_routes')));
                       
        if($return)
        {
            $slug_count++;
            $slug = $slug.$slug_count;   
        }
        else
        {
            $slug = ($slug_count == '0')?$slug:$slug.$slug_count;  
        }
		
		return $slug;
	}
 
     public function execInBackground($cmd) 
     {
        if (substr(php_uname(), 0, 7) == "Windows"){
            pclose(popen("start /B ". $cmd, "r"));
        }
        else {
            exec($cmd . " > /dev/null &"); 
        }
    }
