     /*
     purpose  : To configure the domain settings
     params   : domain id
     developer: Lineesh
      */
     private function domain_settings($id)
     {
        $this->lang->load('onboarding');
        $this->load->model(array('Onboarding_model'));

         $settings                           = $this->Onboarding_model->setting_skeletons();
         if(!empty($settings))
         {
            $settings_query                = " INSERT INTO `account_settings` ( `as_account_id`, `as_key_id`,  `as_setting_value`,  `as_superadmin_value`, `as_siteadmin_value`,`updated_date`) VALUES ";
             foreach($settings as $setting)
             {
                 $setting_configured         = $this->Onboarding_model->account_setting($setting['id'], $id);//checks settings already configured    
                 if(empty($setting_configured))
                 {
                     $save                           = array();
                     $save['id']                     = false;
                     $save['as_account_id']          = $id;
                     $save['as_key_id']              = $setting['id'];
                     $save['as_setting_value']       = $setting['sk_value_format'];
                     $save['as_superadmin_value']    = $setting['sk_super_admin'];
                     $save['as_siteadmin_value']     = $setting['sk_site_admin'];
                     $save['updated_date']           = date("Y-m-d H:i:s");
                     $settings_value[]               = "( '".$save['as_account_id']."', '".$save['as_key_id']."',  '".$save['as_setting_value']."', '".$save['as_superadmin_value']."','".$save['as_siteadmin_value']."','".$save['updated_date']."')";

                     //$this->Onboarding_model->saveAccountSettings($save);
                 }
             }
             $settings_query   .= implode($settings_value,',').';';
             return $settings_query;
         }
     }
 
     private function make_directory($path=false)
     {
         if(!$path )
         {
             return false;
         }
         if (!file_exists($path)) {
             mkdir($path, 0777, true);
         }
     }
 
