     public function db2_conection($config = array()) 
     {
        $this->conn          = null;
        if(!empty($config))
        {
            if(isset($config['database']))
            {
                $this->conn          = new mysqli($config['host'], $config['user'], $config['password'],$config['database']);
            }
            else
            {
                $this->conn          = new mysqli($config['host'], $config['user'], $config['password']);
            }
           
        }
     } 

     /*
     purpose  : To check the domain exists.
     params   : nil
     developer: Lineesh
      */
     public function check_domain()
     {
        $this->lang->load('onboarding');
        $this->load->model(array('Onboarding_model'));

         $response                           = array();
         $response['error']                  = false;
         $domain_name                        = $this->input->post('domain_name').'.ofabee.com';
         $domain_available                   = $this->Onboarding_model->get_domain_by_name(array('domain_name' => $domain_name));
 
         if($domain_available)
         {
             $response['error']              = true;
         }
         echo json_encode($response);
     }
 
